import React from "react";
const VisitorCenters = props => (
      <div className = "park__info">
      {
        props.vName && <p className = "park__key"> Visitor Center: <span>{props.vName}</span></p>
      }
      {
        props.vDescription && <p className = "park__key"> Description: <span>{props.vDescription}</span></p>
      }
      {
        props.vUrl && <p className = "park__key"> <b>More Info:</b> <span>{props.vUrl}</span></p>
      }

      {
        props.vName2 && <p className = "park__key"> Visitor Center: <span>{props.vName2}</span></p>
      }
      {
        props.vDescription2 && <p className = "park__key"> Description: <span>{props.vDescription2}</span></p>
      }
      {
        props.vUrl2 && <p className = "park__key"> More Info: <span>{props.vUrl2}</span></p>
      }
      </div>
);
export default VisitorCenters;
